import React, { Component } from "react";
import { Button } from "react-bootstrap";

export class Discover extends Component {
  render() {
    const elements = [];
    for (var i = 0; i++; i < 6) {
      elements.push(<i class="fas fa-star" />);
    }

    return (
      <div
        className="banner-gradient text-center text-white"
        style={{
          backgroundImage:
            "url(https://cdn.vox-cdn.com/uploads/chorus_asset/file/16282419/The_Verge_GOT_Landscape_Wallpaper.0.png)"
        }}
      >
        <h2>Film Name</h2>
        <h1>Discover Films</h1>
        <p>
          {elements.map(cur => (
            <i class="fas fa-star" />
          ))}
        </p>
      </div>
    );
  }
}

export default Discover;
